import React from 'react';



const ImageLinkForm = () => {
    return (
        <div className="container">
            <h1>{'This is a face detector to detect faces from your pictures. Please try it'}</h1>
            <form className="form">
                <input type='text' placeholder="please put image url here"></input>
                <button type="submit">Detect</button>
            </form>
        </div>
    );
}

export default ImageLinkForm;
